ライト系洗剤／ライト系洗剤<br>ひと目でお洗濯が楽しくなる様な、色鮮やかで楽しげなパッケージ！<br>【ボールドトータル】ひと目でお洗濯が楽しくなる様な、色鮮やかで楽しげなパッケージ！<br>【ボールドジェル／粉末】新しいボールド香りのサプリインジェルは、ジェルの色がピンクになりました。<br>香りのサプリもＰｏｎ！と弾けてお洗濯が楽しくなる！<br><br>商品名：Ｐ＆Ｇジャパン ＊ボールド香りのおしゃれ着洗剤詰替え用４００Ｇ <br>＜2013年秋の新製品＞  ※ 9月7日 より順次出荷予定<br>ボールド　香りのおしゃれ着洗剤詰替４００Ｇ<br>ブランド：ボ－ルド<br><br>ひと目でお洗濯が楽しくなる様な、色鮮やかで楽しげなパッケージ！<br><br> JAN：4902430515801<br>販売元：　Ｐ＆Ｇジャパン<br><br>CS：16<p>●柔軟剤入りだからふんわり仕上がるおしゃれ着用洗剤。型くずれ、色あせ、シワも防ぎます。<br>●わくわくベリー＆フラワーの香り<br>●詰め替え用<br><br>【使用方法】<br>★お洗濯アドバイス<br>・使用量の目安に従い、設定量の水にボールドおしゃれ着洗剤をよく溶かしてから、衣類を入れてください。これは、洗濯機洗い、手洗い共通です。<br>・脱水は、手洗い・ドライなどのコースで1分以内。<br>・洗濯後はすぐに、形を整えて平らに陰干しなどに。<br>・ドラム式洗濯機は、必ず「ドライコース」を使用。<br>※蛍光増白剤は配合していません。(ただし、生産設備が蛍光増白剤配合の洗剤と共用のため、微量に検出されることがあります。)<br><br>【成分】　<br>界面活性剤(17％：アルキルエーテル硫酸エステル塩、純せっけん分(脂肪酸ナトリウム)、ポリオキシエチレンアルキルエーテル)、安定化剤、pH調整剤、水軟化剤、柔軟化剤 <br><br>【注意事項】<br>・用途外に使わない。<br>・子供の手の届くところに置かない。<br>・荒れ性の方や原液で使用するときは、炊事用の手袋を使う。<br>・洗濯機のフタなどのプラスチック部分についた時は、水で拭き取る。放置すると傷むことがある。<br>・容器を、本製品以外のつめかえに使用しないでください。<br>　</p><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
