パックスナチュロン 衣類のリンス 詰替用 500ml<br>ブランド：パックスナチュロン<br>販売・製造元：太陽油脂<br><br>ヒノキチオールを配合した柔軟剤、「パックスナチュロン 衣類のリンス 610ml」のお得な詰替用です。<br>ヒノキチオールを配合。<br>雑菌の繁殖を防ぎ、黄ばみやニオイの発生を防ぎます。<br>合成界面活性剤、合成殺菌剤、シリコンなどの合成化学物質は使用していません。<br>フローラルブーケの爽やかな香り。<br> <br>成分クエン酸、天然ガム、エチルアルコール、ヒノキチオール、香料 用途衣料品(綿、麻、化学せんい等) 開封のしかた●パックスナチュロン衣類のリンス詰替用はボトルに詰替えてご使用下さい。<br>●詰替用のプラスチックの量は少ないので、資源を節約し大切にします。<br>1、点線部分をハサミで切って下さい。<br>2、ボトルにゆっくりとそそぎご使用下さい。<br>3、力のある方でしたら、キャップを根元部分よりはずして、ボトルにそそぎご使用下さい。<br>(根元部分は固く閉まっています。<br>)*本品は飲み物ではありません。<br> 使い方全自動の場合●洗濯機の柔軟剤投入口に入れてお使いください。<br>●投入方法につきましては洗濯機の取扱説明書をお読みください。<br>二槽式の場合●すすぎの水が透明になったら注水を止め「衣類のリンス」を入れます。<br>●洗濯物全体に行届くように2-3分回します。<br>●そのまま排水、脱水してください。<br>*洗いおけの場合は、約3分間ひたし、絞って干してください。<br>(水7Lに対して2.2ml) 使用量の目安水衣類のリンス30L10ml(キャップ約1杯)50L16.6ml(キャップ約1杯と2/3杯)*透明キャップが計量容器になっています。<br>●10mlで洗濯物1.5kg、タオルなら約20枚分。<br> <br><br>使用上の注意<br>●石けんと一緒に洗濯槽に入れないでください。<br>●飲み込んだ場合は水を飲ませるなどの処置を必ずしてください。<br>●洗濯物に直接かけないでください。<br>●用途以外には使用しないでください。<br>●使用後は必ずしっかりとキャップを閉めてください。<br>*次回から詰替用をご利用ください。<br> 柔軟剤とは柔軟剤は、洗濯後の衣類の静電気を防止し、ふんわりとした柔軟性を与えるための仕上げ剤です。<br>香りが長く続く柔軟剤、防臭タイプの柔軟剤、乾燥機専用の柔軟剤シートなどが揃っています。<br><br>日用品／洗濯用品／柔軟剤/静電気・シワ対策／自然派 柔軟剤<br>JANコード： 4904735053477<br><br>CS：12<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
